import { combineReducers } from "redux";
import { appReducer } from "./reducers/appReducer";
import { tobaccoReducer } from "./reducers/tobaccoReducer";

export const rootReducer = combineReducers({
	tobacco: tobaccoReducer,
	app: appReducer,
});
